INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("リン", "2030/12/17 14:59:59", 24, "あたしだって\nやるときはやるよ！", 0, "2020/04/30 12:00:00", 24001, 1, 0.0, 10040, 0.0, 102601, 0.0, 1);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("リン", "2030/12/17 14:59:59", 24, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, "2020/04/30 12:00:00", 24002, 1, 0.0, 10040, 0.0, 102601, 0.0, 1);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("リン", "2030/12/17 14:59:59", 24, "終わった終わった\n一人でもなんとか\nなるもんだね", 2, "2020/04/30 12:00:00", 24003, 1, 0.0, 10040, 0.0, 102601, 0.0, 1);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("リン", "2030/12/17 14:59:59", 24, "やったね！\nこれでようやく\nサボれるよ…", 3, "2020/04/30 12:00:00", 24004, 2, 0.0, 10040, 0.0, 102601, 0.0, 2);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("リン", "2030/12/17 14:59:59", 24, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 4, "2020/04/30 12:00:00", 24005, 1, 0.0, 10040, 0.0, 102601, 0.0, 1);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("リン", "2030/12/17 14:59:59", 24, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 5, "2020/04/30 12:00:00", 24006, 2, 0.0, 10040, 0.0, 102601, 0.0, 2);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("リン", "2030/12/17 14:59:59", 24, "あたしも意外と\nやるもんでしょ？", 6, "2020/04/30 12:00:00", 24007, 2, 0.0, 10040, 0.0, 102601, 0.0, 2);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("リン", "2030/12/17 14:59:59", 24, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 7, "2020/04/30 12:00:00", 24008, 4, 0.0, 10040, 0.0, 102601, 0.0, 4);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("リン", "2030/12/17 14:59:59", 24, "このままじゃ\nまっひ～に\n叱られちゃうよ", 8, "2020/04/30 12:00:00", 24009, 4, 0.0, 10040, 0.0, 102601, 0.0, 4);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("リン", "2030/12/17 14:59:59", 24, "まじめに\nやったんだけどな…\n悔しいな～", 9, "2020/04/30 12:00:00", 24010, 4, 0.0, 10040, 0.0, 102601, 0.0, 4);
